import React from "react";
import { COLORS } from "../Constants";
import styled from "styled-components";
import Footer from "./Footer";

const Reservations = () => {
  return (
    <>
      <Wrapper>
        Reservations
        <Footer />
      </Wrapper>
    </>
  );
};

export default Reservations;

const Wrapper = styled.div`
  font-size: 55px;
  color: white;
`;
